const CardComponent = ({ Cards }) => {
    return (
        <div>
            <h2>Nombre: {Cards.name}</h2>
            <h2>Descripcion: {Cards.description}</h2>
            <Image></Image>
        </div>
    );
};


CardComponent.propTypes = {
    card: PropTypes.instanceOf(Card)
};


